message:
Quando eu falei no Twitter que Lula foi o candidato da CIA para salvar a economia americana do Biden, eu não estava brincando. É que quando você cita a CIA no meio da história, parece que logo vão vir OVNIs ou ligações atípicas demais, mas tudo está contido em provas primárias e um simples Google pode sanar essas dúvidas.

1. O diretor da CIA realmente ligou há 5 meses atrás para o PR Bolsonaro, intimando-o a aceitar o resultado das eleições. Isso foi documentado pelo periódico britânico The Guardian, e também foi comentado pelo programa do Tucker Carlson na Fox News a audácia do diretor indicado por Biden simplesmente ter perdido a vergonha na cara para intimidar um chefe de Estado de uma nação soberana;

2. Quando o Risco-Brasil sobe (e de ontem para hoje subiu 10%), é porque está sendo prevista uma instabilidade monetária, inflacionária, diminuição do PIB ou instabilidade política;

3. Lula têm tido falas absolutamente hostis a qualquer respeito às leis comuns de mercado. Abertamente, num período posterior às eleições, tem dito que “gasto público é investimento” e, hoje, falou que “a bolsa vai cair, o dólar vai subir, paciência”, indicando que não está nem um pouco se importando com fatores inflacionários ou com a política monetária;

4. Diante de nossa dependência referencial monetária em relação ao dólar, Lula sabe muito bem que quando impõe um risco econômico, a tendência é de que investidores tirem o seu dinheiro do país, o que significa evasão da moeda americana para os seus países de origem;

5. Quem ganha com isso? EUA, União Européia e China, que aproveitam de novas bonanças financeiras às custas de nossa perda, com a reposição monetária originada da desistência de uma série de investimentos em massa. Basta só ver como as bolsas desses países simplesmente crescem muito a cada bobagem proposital que Lula fala para assustar nossos investidores;

6. O Brasil é praticamente um continente. Uma economia muito grande e uma tendência expansiva sempre muito grande. É imensamente atrativo para investidores externos, mas também sempre foi a casa saqueada por bilionários globalistas e por governos de esquerda que desejam a destruição de nossa soberania;

7. Lula serve a esses grupos historicamente. Conseguiu unir o tucanismo-globalista ao PT do Foro de São Paulo, com o objetivo de derrotar o candidato do patriotismo. Nos anos 90, também estava com seu nome e o de Fernando Henrique Cardoso no Diálogo Interamericano, organização essa pertencente à Fundação Ford;

8. O que estamos vendo é o típico neocolonialismo que sempre aconteceu quando governos democratas encontram-se no poder americano: imposição de políticas diplomáticas, econômicas e sociais do jeito que a elite que pauta o deep state americano e a União Européia sempre fizeram. E o Brasil sempre foi a menina dos olhos da América do Sul para todos eles.
